    </div>
  </div>
        </nav>
        </nav>
        <Switch>
        <Route path="/dedicate">
            <Dedicate />
          </Route>
          <Route path="/vps">
            <VPS />
          </Route>
          <Route path="/Affiliate">
            <Affiliate />
          </Route>
          <Route path="/reseller">
            <Reseller />
          </Route>
          <Route path="/hosting">
            <Hosting />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return <HomePage/>;
}
function Hosting() {
  return <Shared/>;
}
function Reseller() {
  return <ResellerMain/>;
}
function Affiliate() {
  window.scrollTo(0, 0);
  return <AffiliateHome />;
}
function VPS() {
  return <VpsMain/>;
}
function Dedicate() {
  return <DedicateMain/>;
}
